  INDEX `idx_flow_task_id`(`flow_task_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '工作流任务待办人' ROW_FORMAT = Dynamic;

